window.bookSummaryJSON = "<p><b>Three Volumes in a single offering!</b></p> <p>In a Post-Apocalyptic world of Magic and Machinery, Jack Knight is an orphan who finds himself caught between a life-altering decision.</p> <p>Join the military and fight the demon hordes or sell his soul to the Corpos. Both options having minimal appeal to a shut-in like Jack. Thanks to the high cost of living, and his sister’s medical expenses, Jack has never given much thought to what he’d want to do with life, always living paycheck to paycheck, scrounging just enough to keep the lights on and his sister safe. However, in a strange turn of events that nearly kills him, an Angel presents him with a third option.</p> <p><b>Awaken and become her instrument of revenge with the ultimate power.</b></p>"; 
